import React from 'react';
import './Register.css'
import Photo from './Photo.js'
class  Register extends React.Component{
   constructor(props) {
    super(props);
    this.handleClick = this.handleClick.bind(this);
     this.state = {
      email: " ",
      Name: " ",
      Surname: "",
      Phone: " ",
      Password: " ",
      PasswordAgain: " "
    };

  }
  handleEmail(e) {
   this.setState({email: e.target.value});
  }
  handleName(e) {
   this.setState({Name: e.target.value});
  }
  handleSurname(e) {
   this.setState({Surname: e.target.value});
  }
  handlePhone(e) {
   this.setState({Phone: e.target.value});
  }
  handlePassword(e) {
   this.setState({Password: e.target.value});
  }
  handlePasswordAgain(e) {
   this.setState({PasswordAgain: e.target.value});
  }
  handleClick = () => {
    console.log('this is:', this.state.Name);
  }
  render() {
    return (
    <div>
    <h1>Register Page</h1>
    <form>
      <label>Name:</label><br/>
      <input  type="text" id="Name" name="Name" defaultValue={this.state.Name}  onChange={this.state.Name} size="60"/><br/>
      <label>Surname:</label><br/>
      <input  type="text" id="Surname" name="Surname"  defaultValue={this.state.Surname}  onChange={this.state.Surname} size="60"/><br/>
      <label>Email_Address:</label><br/>
      <input  type="text" id="Email_Address" name="Email_Address" defaultValue={this.state.email} onChange={this.state.email} size="60"/><br/>
      <label>Phone_Number:</label><br/>
      <input  type="text" id="Phone_Number" name="Phone_Number" defaultValue={this.state.Phone} onChange={this.state.Phone} size="60"/><br/>
      <label>Password:</label><br/>
      <input  type="text" id="Password" name="Password" defaultValue={this.state.Password} onChange={this.state.Password} size="60"/><br/>
      <label>Password_Again:</label><br/>
      <input  type="text" id="Password_Again" name="Password_Again" defaultValue={this.state.PasswordAgain} onChange={this.state.PasswordAgain} size="60"/><br/>
      <Photo/>
      <br/>
      <br/>
      <button onClick={this.handleLogin}>
      Submit
      </button>
    </form>
    </div>
  );
  }
}

export default Register;
